-- -----------------------------------------------------
-- View `ForumDB`.`mod_team`
-- -----------------------------------------------------
DROP TABLE IF EXISTS `ForumDB`.`mod_team`;
DROP VIEW IF EXISTS `ForumDB`.`mod_team` ;
USE `ForumDB`;
CREATE  OR REPLACE VIEW `mod_team` AS
SELECT Mods.username, Roles.role_color
FROM Roles INNER JOIN 
(SELECT *
FROM Users
WHERE role_name<>"user") AS Mods
ON Roles.role_name=Mods.role_Name;

