INSERT INTO `ForumDB`.`Posts` (`post_id`, `date`, `content`, `user_email`, `thread_id`) VALUES (1, '2021-10-19 01:00:00', 'Τελευταία βλέπω πολλούς που ταξιδεύουν/θέλουν να ταξιδέψουν στο εξωτερικό. Χρησιμοποιήστε αυτό το thread για να μας πείτε τι γνώμη σας για ταξίδια!', 'nvel18@gmail.com', 1);
INSERT INTO `ForumDB`.`Posts` (`post_id`, `date`, `content`, `user_email`, `thread_id`) VALUES (2, '2021-10-23 01:00:00', 'Μάγκες μου ήρθε το γράμα.... Η ζωή μου τελείωσε... Θα μου λείψετε όλοι... Αν έχετε κανένα tip να μοιραστείτε ευπρόσδεκτο...', 'vsak42@gmail.com', 2);
INSERT INTO `ForumDB`.`Posts` (`post_id`, `date`, `content`, `user_email`, `thread_id`) VALUES (3, '2021-10-25 01:00:00', 'Ακούω πολλά για αιμοδοσία (ποσο καλή είναι και καλα κτλ), όμως έχω κάποιους ενδοιασμούς. Ξέρει κανείς πόσο αίμα σου παίρνουνε; Πόση ώρα κρατάει η διαδικασία; Πονάει πολύ;', 'ttyr@yahoo.gr', 3);
INSERT INTO `ForumDB`.`Posts` (`post_id`, `date`, `content`, `user_email`, `thread_id`) VALUES (4, '2021-10-01 13:00:00', 'Δυστυχώς, μετά από 2 χρόνια, το Asus vivobook μου απεβίωσε. Τώρα ψάχνω laptop με budget μέχρι 600 ευρώ. Θα το χρησιμοποιήσω κυρίως για σχολή αλλά και προχωπική χρήση. Δεν θα gameάρω, αλλά θέλω να έχει nvidia GPU για να βγάλω την εργασία παράλληλα. Αν προσφέρει κάποιος μεταχειρισμένο, μπορεί να μου στείλει PM να το συζητήσουμε.', 'ttyr@yahoo.gr', 4);
INSERT INTO `ForumDB`.`Posts` (`post_id`, `date`, `content`, `user_email`, `thread_id`) VALUES (5, '2021-10-02 01:00:00', 'Για να εμφανιστούμε λίγο οι σινεφίλ του φόρουμ! Εδώ μπορείτε να κάνετε ότι κριτική (no spoilers) ταινιών θέλετε για να παίρνουμε καμία έμπνευση τι να δούμε οι υπόλοιποι.', 'nvel18@gmail.com', 5);
INSERT INTO `ForumDB`.`Posts` (`post_id`, `date`, `content`, `user_email`, `thread_id`) VALUES (6, '2021-10-02 13:10:00', 'LOL δε περίμενα τίποτα παραπάνω από Asus. Απαράδεκτη εταιρία.', 'eksolothreuths@yahoo.gr', 4);
INSERT INTO `ForumDB`.`Posts` (`post_id`, `date`, `content`, `user_email`, `thread_id`) VALUES (7, '2021-10-03 13:15:00', 'Εγώ έχω αρκετά καλή εμπειρία με Lenovo Ideapad. Το έχω 5 χρόνια και δεν έχει πάθει τίποτα και το έχω πάρει μαζί μου παντού. Μπορεί να μην έχει nvidia GPU, αλλά προσωπικά τα είχα βγάλει πέρα μια χαρά με την εργασία στη συστοιχία.', 'babisgate4@gmail.com', 4);
INSERT INTO `ForumDB`.`Posts` (`post_id`, `date`, `content`, `user_email`, `thread_id`) VALUES (8, '2021-10-04 13:20:00', 'Ευχαριστώ πολύ : ). Θα το κοιτάξω', 'ttyr@yahoo.gr', 4);

